const emailElements=document.getElementsByClassName("srfm-input-email-container");if(0<emailElements.length){const a=document.getElementsByClassName("srfm-input-email");a[0].addEventListener("input",t=>{document.querySelector("#srfm-sender-email").value=t.target.value})}const submitButton=document.getElementsByClassName("srfm-button");if(submitButton){const c=getComputedStyle(document.documentElement),d=c.getPropertyValue("--srfm-primary-color"),e=c.getPropertyValue("--srfm-secondary-color");if(""!==d)for(let t=0;t<submitButton.length;t++)submitButton[t].style.backgroundColor=d;if(""!==e)for(let t=0;t<submitButton.length;t++)submitButton[t].style.color=e}